import React, { Component } from 'react';
import { Row, Col, Card, CardHeader, CardBody, Form, FormFeedback, FormGroup, Label, Input } from 'reactstrap';
import motivos from './data/motivos';
import Select from 'react-select';
import 'react-select/dist/react-select.min.css';

const options = motivos.BLOCK; //temporário para aparecer motivs no dropdown

const validate = (getValidationSchema) => {
  return (values) => {
    const validationSchema = getValidationSchema(values)
    try {
      validationSchema.validateSync(values, { abortEarly: false })
      return {}
    } catch (error) {
      return getErrorsFromValidationError(error)
    }
  }
}

const getErrorsFromValidationError = (validationError) => {
  const FIRST_ERROR = 0
  return validationError.inner.reduce((errors, error) => {
    return {
      ...errors,
      [error.path]: error.errors[FIRST_ERROR],
    }
  }, {})
}

const initialValues = {
  idusuario: "",
  accept: false
}

const onSubmit = (values, { setSubmitting, setErrors }) => {
  setTimeout(() => {
    alert(JSON.stringify(values, null, 2))
    // console.log('User has been successfully saved!', values)
    setSubmitting(false)
  }, 2000)
}

class BloquearComprador extends Component {
  //Adaptar para os valores de motivos de bloqueio
  constructor(props) {
    super(props);
    this.saveChanges = this.saveChanges.bind(this);
    this.updateDimensions = this.updateDimensions.bind(this);

    this.motivos = {
      value: ['Não Pagou','Cancela compras'],
      windowWidth: window.innerWidth,
      orientation: 'vertical',
      openDirection: 'down'
    }
  }

  findFirstError (formName, hasError) {
    const form = document.forms[formName]
    for (let i = 0; i < form.length; i++) {
      if (hasError(form[i].name)) {
        form[i].focus()
        break
      }
    }
  }

  validateForm (errors) {
    this.findFirstError('simpleForm', (fieldName) => {
      return Boolean(errors[fieldName])
    })
  }

  touchAll(setTouched, errors) {
    setTouched({
        idusuario: true,
        accept: true
      }
    )
    this.validateForm(errors)
  }

  componentDidMount() {
    this.updateDimensions();
    window.addEventListener('resize', this.updateDimensions);
  }

  componentWillUnmount() {
    window.removeEventListener('resize', this.updateDimensions);
  }

  saveChanges(value) {
    this.setState({ value });
  }

  updateDimensions() {
    const windowWidth = window.innerWidth;
    this.setState((motivos)=> {
      return ({
        windowWidth: windowWidth,
        orientation: windowWidth < 620 ? 'vertical' : 'horizontal',
        openDirection: windowWidth < 620 ? 'up' : 'down'
      });
    });
  }

  render() {
    return (
      <div className="animated fadeIn">
        <h1>Bloquear Comprador!</h1>
        <Row>
          <Col xs="12" sm="6" md="3">
            <Card className="card-accent-primary">
              <CardHeader>
                Bloquear
              </CardHeader>
              <CardBody>
              <Form onSubmit={handleSubmit} noValidate name='bloquearcomprador'>
                <FormGroup>
                  <Label for="idUsusario">First Name</Label>
                  <Input type="text"
                    name="isUsuario"
                    id="isUsuario"
                    placeholder="ID do Usuário"
                    autoComplete="given-name"
                    valid={!errors.idusuario}
                    invalid={touched.idusuario && !!errors.idusuario}
                    autoFocus={true}
                    required
                    onChange={handleChange}
                    onBlur={handleBlur}
                    value={values.idusuario} />
                  <FormFeedback>{errors.idusuario}</FormFeedback>
                </FormGroup>
                <FormGroup>
                  <Select
                    name="motivosbloqueio"
                    value={this.motivos.value}
                    options={options}
                    onChange={this.saveChanges}
                    multi
                  />
                </FormGroup>  

                </Form>
              </CardBody>
              <CardFooter>
              </CardFooter>
            </Card>
          </Col>
          </Row>
      </div>
    );
  }
}

export default BloquearComprador;
